import React from 'react';
import './Item.css'; // Ensure you have the correct CSS for styling

const Item = ({ id, name, image, productUrl, new_price }) => {
  return (
    <div className='item'>
      <img src={image} alt={name} />
      <h3>{name}</h3>
      <p>{new_price}</p> {/* Displaying new price */}
      <a href={productUrl}>View Product</a>
    </div>
  );
};

export default Item;
